/**
 * Stock algorithm (pseudo-code)
 * It assumes there is a global array (a)
 * max_min(i, j, max, min) {
	if (i == j) max = min = a[i]
	else if (i == j - 1) {
		if (a[i] < a[j]) {
			max = a[j]
			min = a[i]
		} else {
			max = a[i]
			min = a[j]
		}
	} else {
		mid = (i + j)/2
		max_min(i, mid. max, min)
		max_min(mid + 1, j, max1, min1)
		if (max < max1) max = max1
		if (min > min1) min = min1
	}
 }
 * With my modifications:
 * FFS, we will take array as function param
 * Also we can do the max and min comparison actually together
 * My algo
 * max_min(i, j, max, min) {
	if (i == j) max = min = a[i]
	else if (i == j - 1) {
		if (a[i] < a[j]) {
			if (a[j] > max) max = a[j]
			if (a[i] < min) min = a[i]
		} else {
			if (a[i] > max) max = a[i]
			if (a[j] < min) min = a[j]
		}
	} else {
		mid = (i + j)/2
		max_min(i, mid. max, min)
		max_min(mid + 1, j, max, min)
	}
 }
 * Also included a naive algorithm for this
 * Turns out that both the algorithms have similar time complexity
 * Both take on an avg of 6ms on a test case with 8192 integers 
 */
 #include <stdio.h>
 #include <limits.h>
 #include <string.h>
#include <time.h>

// Need to brush up my pointers knowledge too, so...
void max_min(int* arr, size_t i, size_t j, int* max, int* min) {
 	if (i == j) {
 		if (*(arr + i) > *max) *max = *(arr + i);
 		if (*(arr + i) < *min) *min = *(arr + i);
 	} else if (i == j - 1) {
 		if (*(arr + i) < *(arr + j)) {
 			if (*(arr + j) > *max) *max = *(arr + j);
 			if (*(arr + i) < *min) *min = *(arr + i);
 		} else {
 			if (*(arr + i) > *max) *max = *(arr + i);
 			if (*(arr + j) < *min) *min = *(arr + j);
 		}
 	} else {
 		size_t mid = (i + j)/2;
 		max_min(arr, i, mid, max, min);
 		max_min(arr, mid + 1, j, max, min);
 	}
 }

 // For comparison
 void naive_max_min(int a[], int n, int* max, int* min) {
	int i = 0;

 	*max = *min = a[0];
 	for (i = 0; i < n; i++) {
 		if (a[i] < *min) *min = a[i];
 		if (a[i] > *max) *max = a[i];
 	}
 }

